import React, { useState } from 'react';
import { CardWrapper, IconWrapper, BoatIcon, CardContainer, CardHeader } from './booking.styles';

const Booking = () => {
	const [state, setState] = useState(false);
	return (
		<div className="main" style={{ paddingTop: '10%' }}>
			<CardContainer>
				<CardWrapper to="/hausboot-rot" onMouseEnter={() => setState(true)}>
					<CardHeader>Hausboot Rot</CardHeader>
					<IconWrapper>
						<BoatIcon color="red" animate={state} />
					</IconWrapper>
				</CardWrapper>
				<CardWrapper to="/hausboot-blau">
					<CardHeader>Hausboot Blau</CardHeader>
					<IconWrapper>
						<BoatIcon color="blue" animate={state} />
					</IconWrapper>
				</CardWrapper>
				<CardWrapper to="/floßboot" animate={state}>
					<CardHeader>Floßboot</CardHeader>
					<IconWrapper>
						<BoatIcon />
					</IconWrapper>
				</CardWrapper>
			</CardContainer>
		</div>
	);
};

export default Booking;
